import React from "react";

const SmallButton = () => {
  return (
    <div>
      <div>                  
              <button className="bg-purple text-white font-semibold  py-2 px-4 border border-blue-500 rounded">
                Enrol Now
              </button>

    </div>
      <div className="flex items-center justify-center">
        <button className="w-[9.2rem] h-[2.5rem] rounded-full bg-white  text-purple p-2 ">
          Contact Team
        </button>
      </div>
    </div>
  );
};

export default SmallButton;
